class MapNode:
    def __init__(self, key, val):
        self.key = key
        self.val= val
        self.next = None
        
class MyHashMap:

    def __init__(self):
        self.bucketSize = 19997
        self.buckets = [None] * self.bucketSize
        self.count = 0
        
    def getIndex(self, hc):
        return (abs(hc) % (self.bucketSize))
    
    def rehash(self):
        temp = self.buckets
        self.buckets = [None] * (2*self.bucketSize)
        self.bucketSize *= 2
        self.count = 0
        for head in temp:
            while head:
                self.put(head.key, head.val)
                head = head.next
    
    def put(self, key, value):
        hc = hash(key)
        index = self.getIndex(hc)
        head = self.buckets[index]
        while head:
            if head.key == key:
                head.val = value
                return 
            head = head.next
        head = self.buckets[index]
        newNode = MapNode(key, value)
        newNode.next = head
        self.buckets[index] = newNode
        self.count += 1
        if self.count/self.bucketSize >= 0.7:
            self.rehash()
    
     

    def get(self, key):
        hc = hash(key)
        index = self.getIndex(hc)
        head = self.buckets[index]
        while head is not None:
            if head.key == key:
                return head.val
            head = head.next   
        return -1

    def remove(self, key):
        hc = hash(key)
        index = self.getIndex(hc)
        head = self.buckets[index]
        prev = None
        while head:
            if head.key == key:
                if prev is None:
                    self.buckets[index] = head.next
                else:
                    prev.next = head.next
                self.count -= 1
                return
            prev = head
            head = head.next
